create table users
(
    username varchar(45)       not null
        primary key,
    password varchar(45)       not null,
    enabled  tinyint default 1 not null
);

INSERT INTO crimeBase.users (username, password, enabled) VALUES ('admin', 'admin', 1);
INSERT INTO crimeBase.users (username, password, enabled) VALUES ('user', 'user', 1);

create table user_roles
(
    user_role_id int auto_increment
        primary key,
    username     varchar(45) not null,
    role         varchar(45) not null,
    constraint uni_username_role
        unique (role, username),
    constraint fk_username
        foreign key (username) references users (username)
);

create index fk_username_idx
    on user_roles (username);

